class Transaction {
    constructor(
        timestampUTC,
        transactionDescription,
        currency,
        amount,
        toCurrency,
        toAmount,
        nativeCurrency,
        nativeAmount,
        nativeAmountUSD,
        transactionKind,
        transactionHash
    ) {
        this.timestampUTC = timestampUTC;
        this.transactionDescription = transactionDescription;
        this.currency = currency;
        this.amount = amount;
        this.toCurrency = toCurrency;
        this.toAmount = toAmount;
        this.nativeCurrency = nativeCurrency;
        this.nativeAmount = nativeAmount;
        this.nativeAmountUSD = nativeAmountUSD;
        this.transactionKind = transactionKind;
        this.transactionHash = transactionHash;
    }
}

const transactions = [];

const rows = data.split('\n');

rows.forEach(row => {
    const [
        timestampUTC,
        transactionDescription,
        currency,
        amount,
        toCurrency,
        toAmount,
        nativeCurrency,
        nativeAmount,
        nativeAmountUSD,
        transactionKind,
        transactionHash
    ] = row.split('\t');

    transactions.push(new Transaction(timestampUTC, transactionDescription, currency, amount, toCurrency || null, toAmount || null, nativeCurrency, nativeAmount, nativeAmountUSD, transactionKind, transactionHash || null));
});

function getRows(predicate) {
    return transactions.filter(predicate);
}
